// Home.jsx
import React, { useEffect } from 'react';
import './Home.css';
import { useTypewriter, Cursor } from 'react-simple-typewriter';

export const Home = () => {
  const [text] = useTypewriter({
    words: ['Front-end Developer', 'UI/UX Designer', 'Web Developer'],
    loop: {},
    typeSpeed: 100,
    deleteSpeed: 70,
  });

  // Parallax effect for background elements
  useEffect(() => {
    const handleMouseMove = (e) => {
      const x = e.clientX / window.innerWidth;
      const y = e.clientY / window.innerHeight;
      
      document.documentElement.style.setProperty('--mouse-x', x);
      document.documentElement.style.setProperty('--mouse-y', y);
    };

    window.addEventListener('mousemove', handleMouseMove);
    
    return () => {
      window.removeEventListener('mousemove', handleMouseMove);
    };
  }, []);

  return (
    <div className="home-container">
      {/* Background elements */}
      <div className="background-shapes">
        <div className="shape shape-1"></div>
        <div className="shape shape-2"></div>
        <div className="shape shape-3"></div>
      </div>

      <div className="content-wrapper">
        {/* Image container */}
        <div className="image-container">
          <div className="image-frame">
            <img 
              className="home-image" 
              src={require('../../assets/YamanHD.png')} 
              alt="Yaman Ajlouni" 
            />
          </div>
        </div>

        {/* Text content */}
        <div className="text-content">
          <h1 className="greeting">Hello, World!</h1>
          <div className="name-container">
            <span className="im-text">I'm</span>
            <span className="name">Yaman Ajlouni</span>
          </div>
          
          <div className="specialty-container">
            <span className="specialty-prefix">A passionate</span>
            <div className="typewriter-container">
              <span className="specialty">{text}</span>
              <Cursor cursorStyle="_" />
            </div>
          </div>

          <div className="cta-container">
            <button className="cta-button primary">View My Work</button>
            <button className="cta-button secondary">Contact Me</button>
          </div>
        </div>
      </div>

      {/* Social links */}
      <div className="social-links">
        <a href="#" className="social-icon" aria-label="GitHub">
          <i className="fab fa-github"></i>
        </a>
        <a href="#" className="social-icon" aria-label="LinkedIn">
          <i className="fab fa-linkedin"></i>
        </a>
        <a href="#" className="social-icon" aria-label="Twitter">
          <i className="fab fa-twitter"></i>
        </a>
      </div>
    </div>
  );
};
